  handleSelectedChip() {

    if(event.target.classList.contains('chip--2wNTT')) {

      document.querySelector('.title--31zOh').textContent = "TOTAL BET"
      this.footer.querySelectorAll('.chip--2wNTT').forEach(el => {
        // DELETE ALL UNACTIVE CLASSES
        el.childNodes[1].classList.remove('selected--rINgO')
        el.childNodes[1].childNodes[1].classList.add('disabled--3foVl')
      })
      // SET ACTIVE COIN
      event.target.childNodes[1].childNodes[1].classList.remove('disabled--3foVl')
      event.target.childNodes[1].classList.add('selected--rINgO')

      this.betValue = parseInt(event.target.childNodes[1].childNodes[1].dataset.value)
    }

  }

  listeners() {

  this.footer.addEventListener('mouseover', this.handleBlackAndRedId)

  this.footer.querySelectorAll('.black_color')
  .forEach(el => {
    if(!el.parentElement.classList.contains('dddRacetrack-wrapper')) {
    el.addEventListener('mouseleave', () => el.style.fill = "#1A1A1A")
    }
  })

  this.footer.querySelectorAll('.red_color')
  .forEach(el => {
    if(!el.parentElement.classList.contains('dddRacetrack-wrapper')) {
    el.addEventListener('mouseleave', () => el.style.fill = "#DE2201")
    }
  })

  this.footer.querySelector('[data-bet-spot-id=black]')
  .addEventListener('mouseleave', this.handleRedId)

  this.footer.querySelector('[data-bet-spot-id=red]')
  .addEventListener('mouseleave', this.handleBlackId)

  this.footer.addEventListener('click', this.handleChipColor)
  this.footer.addEventListener('click', this.handleSelectedChip)

  this.randomNumber = this.getRandomArbitrary(1, 36)

  }

